import React, { useState } from 'react';
import UploadComponent from './components/UploadComponent';
import HorarioUploadComponent from './components/HorarioUploadComponent';

const App = () => {
    const [currentPage, setCurrentPage] = useState('home');

    const renderPage = () => {
        switch (currentPage) {
            case 'cargaReloj':
                return <UploadComponent onBack={() => setCurrentPage('home')} />;
            case 'cargaHorario':
                return <HorarioUploadComponent onBack={() => setCurrentPage('home')} />;
            default:
                return (
                    <div>
                        <h1>Carga de Archivos</h1>
                        <button onClick={() => setCurrentPage('cargaReloj')}>Carga Reloj</button>
                        <button onClick={() => setCurrentPage('cargaHorario')}>Carga Horario</button>
                    </div>
                );
        }
    };

    return (
        <div>
            {renderPage()}
        </div>
    );
};

export default App;
